import { Table, Button, Tab } from "react-bootstrap";

export default function TodayConsults() {
  return (
    <>
      <Table striped bordered hover responsive className="table-sm">
          <thead>
              <tr>
              <th>ID</th>
                <th>Nombre</th>
                <th>Correo</th>
                <th>Administrador</th>
                <th>Editar</th>  
              </tr>
          </thead>
          <tbody>
              
          </tbody>
      </Table>
    </>
  );
}
